import React from 'react'
import Styled from 'styled-components'
import tw from 'twin.macro'
import name from './img/name.png'

export const Title = () => {
  return (
    <div>
      <Styledmg 
          src={name}
        />
        <ul className=''>
          <li>2020</li>
          <li></li>
        </ul>
    </div>
  )
}
export const Styledmg = Styled.img`
  width: 20%;
  top: 30%;
  left: 15%;
  transform: translate(-15%,-30%);
  ${tw`absolute`};

`
